import React from 'react'
import './contact.css';

const Contact = () => {
  return (
   
    <form className='form'>
        <input type='text'className='name' placeholder='YOUR NAME'></input>
        <input type='email'className='email' placeholder='YOUR EMAIL ID'></input>
        <input type='text'className='name' placeholder='YOUR MESSSAGE'></input>
    </form>
  )
}

export default Contact
